    width: 100vw;
    height: 40px;
    font-size: 1rem;
    p{
        padding:10px;
        color:white;
        font-family: sans-serif;
    }
    @media(max-width:786px)

  `;

  return (
    <Headline>
      <div><p>For any Queries With Your Order Mail Us At kermitcard@gmail.com</p></div>
    </Headline>
  );
};

export default TopHeadline;
